  `id` int(10) unsigned zerofill NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `user_id` int(11) DEFAULT NULL COMMENT '用户',
  `amount` int(10) DEFAULT NULL COMMENT '金额',
